import React from 'react';
import logo from "./assets/shared/logo.svg";
import { Link } from 'react-router-dom';

function Home() {
  return (
   
   <div className="home-background">
      <nav>
      <ul>
        <li>
          <Link to="">Home</Link>
        </li>
        <li>
          <Link to="/about">About</Link>
        </li>
        <li>
          <Link to="/contact">Contact</Link>
        </li>
      </ul>
    </nav>

  
   </div>
   
  )
}

export default Home;
<img src={logo} alt="logo" />
